meta.script:
(function(){ 

  document.onreadystatechange = () => {

    if (document.readyState === 'complete') {

      /**
       * Setup your Lazy Line element.
       * see README file for more settings
       */

      let el = document.querySelector('#react');
      let myAnimation = new LazyLinePainter(el, {"ease":"easeLinear","strokeWidth":7.9,"strokeOpacity":0.9,"strokeColor":"#00D8FF","strokeCap":"square"}); 
      myAnimation.paint(); 
    }
  }

})();
